INSERT INTO `v1_b5b75089bbea3e8f88d466febc30d43722e68857680cd87864c98df21a2e9e10` VALUES ("", 8, 0, 91002, 0, 40000, 100, 0, 1, "", 36);
INSERT INTO `v1_b5b75089bbea3e8f88d466febc30d43722e68857680cd87864c98df21a2e9e10` VALUES ("ぺコリーヌ", 8, 107501, 91002, 1, 40001, 150, 0, 1, "今日は記念日、お祝いですね！\n焼肉、お寿司、ピザ、ケーキ～☆\nあなたとパーティできるなんて、\n幸せです～♪", 37);
INSERT INTO `v1_b5b75089bbea3e8f88d466febc30d43722e68857680cd87864c98df21a2e9e10` VALUES ("コッコロ", 8, 107601, 91002, 1, 40001, 150, 0, 2, "この記念日を迎えられたのは、\n主さまの器量の賜物\nさすがは主さまでございます\nえらい、えらい♪", 38);
INSERT INTO `v1_b5b75089bbea3e8f88d466febc30d43722e68857680cd87864c98df21a2e9e10` VALUES ("キャル", 8, 107801, 91002, 1, 40001, 150, 0, 3, "あんたもけっこうやるじゃない！\nちょっとは…割と…け、けっこう\n見直しちゃったわ\n褒めてあげる♪", 39);
INSERT INTO `v1_b5b75089bbea3e8f88d466febc30d43722e68857680cd87864c98df21a2e9e10` VALUES ("スズメ", 8, 107701, 91002, 1, 40001, 150, 0, 4, "あなたと私にとって、\n今日は特別な日\nあなたの支えがあるから、\n私は頑張れるんです！", 40);
INSERT INTO `v1_b5b75089bbea3e8f88d466febc30d43722e68857680cd87864c98df21a2e9e10` VALUES ("タマキ", 8, 107901, 91002, 1, 40001, 150, 0, 5, "今日はキミにとっての\n特別な記念日だにゃ\nキミの活躍にはいつも\n猫ながら感謝してるにゃ～♪", 41);
INSERT INTO `v1_b5b75089bbea3e8f88d466febc30d43722e68857680cd87864c98df21a2e9e10` VALUES ("ぺコリーヌ", 8, 107501, 91002, 2, 40001, 150, 0, 6, "う～かき氷食べ過ぎて、\n身体が冷えちゃいました…\nあなたの体温で温めてください！\nギューーッ♪", 42);
INSERT INTO `v1_b5b75089bbea3e8f88d466febc30d43722e68857680cd87864c98df21a2e9e10` VALUES ("コッコロ", 8, 107601, 91002, 2, 40001, 150, 0, 7, "夏は危険がいっぱいと申します…\nですが、わたくしが主さまを\nしっかりとお守りいたしますよ", 43);
INSERT INTO `v1_b5b75089bbea3e8f88d466febc30d43722e68857680cd87864c98df21a2e9e10` VALUES ("キャル", 8, 107801, 91002, 2, 40001, 150, 0, 8, "ん～なんであんたと、ひと夏を\n過ごすことになったのかな…\n結構楽しいからいいけど！\nさ、まだまだ遊ぶわよ！", 44);
INSERT INTO `v1_b5b75089bbea3e8f88d466febc30d43722e68857680cd87864c98df21a2e9e10` VALUES ("スズメ", 8, 107701, 91002, 2, 40001, 150, 0, 9, "あなたと過ごすはじめての夏…\nいまからドキドキが止まりません\n楽しくて素敵な思い出が、\nまた一つ増えるんですね♪", 45);
INSERT INTO `v1_b5b75089bbea3e8f88d466febc30d43722e68857680cd87864c98df21a2e9e10` VALUES ("タマキ", 8, 107901, 91002, 2, 40001, 150, 0, 10, "夏は一番の稼ぎ時にゃのに、\n今年はキミと過ごしたいって\n思ってるにゃ楽しい思い出\n増やしてくれるかにゃ？", 46);
INSERT INTO `v1_b5b75089bbea3e8f88d466febc30d43722e68857680cd87864c98df21a2e9e10` VALUES ("", 8, 0, 91002, 0, 40003, 150, 0, 1, "", 57);
